import React from 'react';
import logo from './googlelogo_color.png';
import './App.css';
import './/components/Container.css';
import './/components/Navbar.css';
import './/components/Logo.css';
import { BeakerIcon } from '@heroicons/react/solid'

function App() {
  return (
    <div className="container">
      <header className="navbar">
        <ul>
          <li><a href="#" alt="Gmail">Gmail</a></li>
          <li><a href="#" alt="Images">Images</a></li>
          <li>
            <a class="gb_A" href="#" alt="Gapps">
              <svg className="gb_Se" focusable="false" viewBox="0 0 24 24">
                <path d="M6,8c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM12,20c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM6,20c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM6,14c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM12,14c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM16,6c0,1.1 0.9,2 2,2s2,-0.9 2,-2 -0.9,-2 -2,-2 -2,0.9 -2,2zM12,8c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM18,14c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2zM18,20c1.1,0 2,-0.9 2,-2s-0.9,-2 -2,-2 -2,0.9 -2,2 0.9,2 2,2z"></path>
              </svg>
            </a>
          </li>
          <li>
            <a class="gb_B" href="#" alt="profile">
              <BeackerIcon className="h-5 w-5 text-blue-500"/>"
            </a>
          </li>
        </ul>
      </header>
      <main>
        <div className="logo"><img src={logo}
        alt="logo" /></div>

      </main>
      <footer>

      </footer>
    </div>
  );
}

export default App;
